<!DOCTYPE html>
<html lang="en-us">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
    <title>Unity WebGL Player | CWC-Prototype-5</title>
    <link rel="shortcut icon" href="proto5-Build/TemplateData/favicon.ico">
    <link rel="stylesheet" href="proto5-Build/TemplateData/style.css">
    <script src="proto5-Build/TemplateData/UnityProgress.js"></script>
    <script src="proto5-Build/UnityLoader.js"></script>
    <script>
      var gameInstance = UnityLoader.instantiate("gameContainer", "proto5-Build/Proto5-Build.json", {onProgress: UnityProgress});
    </script>
  </head>
  <body>
    <div class="webgl-content">
      <div id="gameContainer" style="width: 960px; height: 540px"></div>
      <div class="footer">
        <div class="webgl-logo"></div>
        <div class="fullscreen" onclick="gameInstance.SetFullscreen(1)"></div>
        <div class="title">CWC-Prototype-5</div>
      </div>
    </div>
  </body>
</html>
